PlausibilityCtrl:
Program: |+1
 // Method task:
 // determine the exact position where the transported MU will be placed
 // This position is necessary to position the portal and the trolley at the 
 // correct location.
 //
 // Parameters	: Target: the target object where to place the MU
 //
 // ReturnValues : the world coordinate of the place where the MU will be placed or picked
 //---------------------------------------------------------------------------------
 
 param Gantry, Target: object -> length[3]
 
 var is2Dimensional:boolean
 
 switch Target.internalClassType
 case "Part", "Container"
 	return Gantry._3D.getPositionOfObject(Target, [0, 0, Target.MuHeight])
 case "Transporter"
 	is2Dimensional := Target.LoadbayType.isSet("Store")
 else -- all other objects
 	is2Dimensional := Target._3D.hasAttribute("MUAnimationAreaEnabled")
 end
 
 if is2Dimensional
 	var place: any := Target.findFreePlace
 	var px, py: integer
 	
 	if place = void
 		target.MU(1).getStoragePlace(px, py)
 	else
 		place.getStoragePlace(px, py)
 	end
 			
 	return Gantry._3D.getPositionOfObject(Target, Target._3D.getMUAnimationPosition(px, py))
 elseif target._3D.hasAttribute("BaseHeight")
 	return Gantry._3D.getPositionOfObject(Target, Target._3D.getMUAnimationPosition(0))
 else
 	return Gantry._3D.getPositionOfObject(Target, Target._3D.getMUAnimationPosition())	
 end
